import "./Styles.css";

const Timebar = () => {
  let currentDate = new Date();
  let newDate;
  let week = [];
  for (var i = 0; i <= 6; i++) {
    newDate = new Date(
      currentDate.getFullYear(),
      currentDate.getMonth(),
      currentDate.getDate() + i
    );

    week.push({date:newDate.toDateString(),id:i});
  }
  return (
    <div>
      <table>
        <thead>
          <tr>
              <th>
                  Center Name
              </th>
            {week.map((day) => <th>{day.date}</th>)}
          </tr>
        </thead>
        <tbody>

        </tbody>
      </table>
    </div>
  );
};

export default Timebar;
